import styled from "styled-components";
import Title from "../../ui/title/title";
import { Img, P } from "../../styled";

export const Section = styled.section`
  width: 770px;
  margin: 0 auto;
  margin-bottom: 120px;
  font-size: 18px;
  line-height: 26px;
`;

export const StyledTitle = styled(Title)`
  margin-bottom: 55px;
  text-align: center;
`;

export const StyledImg = styled(Img)`
  width: 770px;
  height: 301px;
  margin-bottom: 17px;
`;

export const Caption = styled(P)`
  font-size: 16px;
  line-height: 19px;
  color: #8693a4;
  margin-bottom: 33px;
`;

export const NewsTitle = styled(Title)`
  margin-top: 33px;
  margin-bottom: 27px;
`;

export const Text = styled(P)`
  margin: 12px 0;
  
`;
